mariekeeyskoot
Today is the Dutch edition of @SharetheMicNow - an American initiative in which amazing women of colour take over the social media platforms of white celebrities with a large following. Also in the Netherlands important thought leaders and big names take part; you'll find them via hashtag #SharetheMicNowNL.
Now I don't have a massive amount of followers (I appreciate every single one of you!), and I also don't want to come across as condescending - as if someone with fab talent would need my help. Yet, I want to do what I can to support this movement of change. Therefore I reached out myself to someone to offer my platform Full disclosure - we couldn't make it happen for this day (but we might some other day!), and so I chose to highlight the extremely smart and impressive women of colour who inspire me every day and who have influenced the way I see the world and my responsibilities in a major way. Please give them a follow if you don't already, it will change your life. Thank you.

PS It is impossible to summarise the breadth of knowledge and power of these women. I don't have more space, but they are so much more than this. And there are so many more as well - amongst others @anoushanzume, @bodyposipanda, @naomiepieter, @amatmoekrim and @natachaharlequin come to mind immediately. And more... I wish I could name every single one of you #thankyou

